import React, { Component } from 'react';
import { Card, Switch, Tag } from 'antd';
import 'antd/dist/antd.css';

export class App extends Component {
  state = {
    denomination: false
  }

  onChange = (value) => {
    this.setState({denomination: value});
  }

  render() {
    return (
      <Card title="ATM Machine" style={{ width: 300, textAlign: "center", margin: "auto" }}>
        <Switch onChange={this.onChange} unCheckedChildren="Denomination" checkedChildren="Denomination"/>
        <p>Available Notes :</p>
        <Tag color="magenta">10</Tag>
        <Tag color="red">red</Tag>
        <Tag color="volcano">volcano</Tag>
        <Tag color="orange">orange</Tag>
        <Tag color="gold">gold</Tag>
        <Tag color="lime">lime</Tag>
        <Tag color="green">green</Tag>
        <Tag color="cyan">cyan</Tag>
        <Tag color="blue">blue</Tag>
        <Tag color="geekblue">geekblue</Tag>
        <Tag color="purple">purple</Tag>
      </Card>
    )
  }
}

export default App
